  true,\n\t\"url\": null,\n\t\"notes\": \"Notice to Data Users: The documentation
  for this data set was provided solely by the Principal Investigator(s) and was not
  further developed, thoroughly reviewed, or edited by NSIDC. Thus, support for this
  data set may be limited.nnThis data set contains snow ice temperature measurements
  collected over sea ice in the Barrow, Alaska USA area as part of the joint in situ
  and aircraft AMSRIce03 campaign conducted in March 2003.  The snow ice temperature
  data were collected on 13 March 2003 and on 20 March 2003.  Data set parameters
  are ice temperature, air temperature, snow/ice interface temperature, and snow depth.
  \ Temperatures were measured using a thermistor probe.  Snow depth was measured
  with a self-recording depth probe.  The total volume of this data set is approximately
  11 kilobytes.  Data are provided in five American Standard Code for Information
  Interchange (ASCII) text files and are available via FTP.nnThese data were collected
  as part of a validation study for the Advanced Microwave Scanning Radiometer - Earth
  Observing System (AMSR-E). AMSR-E is a mission instrument launched aboard NASA's
  Aqua Satellite on 04 May 2002.\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
